                    Content of Tab 2
                </TabPane>
                <TabPane tab={<img src='https://picsum.photos/300' alt='123' className='rounded-full w-16' />} key="3">
                    Content of Tab 3
                </TabPane>
            </Tabs>
        </>
    );
}
